import React from 'react';
import Products from './components/Products'
import Details from './components/Details'
import Cart from './components/Cart'
import Login from './components/Login'


function App() {
  return (
    <div className="App">
      <Products />
      <Details />
      <Cart />
      <Login />
    </div>
  );
}

export default App;
